import React from 'react';
import { Container, Typography, Grid, Card, CardContent } from '@mui/material';
import { Pie, Bar } from 'react-chartjs-2';
import { Chart as ChartJS, ArcElement, BarElement, CategoryScale, LinearScale, Tooltip, Legend } from 'chart.js';

ChartJS.register(ArcElement, BarElement, CategoryScale, LinearScale, Tooltip, Legend);

const HomePage = () => {
  const pieData = {
    labels: ['UPSC', 'NEET', 'JEE', 'Banking'],
    datasets: [
      {
        data: [30, 20, 25, 15],
        backgroundColor: ['#2196f3', '#4caf50', '#ff9800', '#f44336'],
        borderWidth: 1,
      },
    ],
  };

  const barData = {
    labels: ['January', 'February', 'March', 'April'],
    datasets: [
      {
        label: 'Students Appeared',
        data: [1200, 1500, 1000, 1700],
        backgroundColor: '#3f51b5',
      },
    ],
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        ðŸ“ˆ Dashboard Overview
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6">Exam Distribution</Typography>
              <Pie data={pieData} />
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6">Students by Month</Typography>
              <Bar data={barData} />
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default HomePage;
